import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 50-73.3 Reserved name.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.3.md","filePath":"vacode/50-73.3.md"}'),i={name:"vacode/50-73.3.md"},o=t('<h1 id="§-50-73-3-reserved-name" tabindex="-1">§ 50-73.3 Reserved name. <a class="header-anchor" href="#§-50-73-3-reserved-name" aria-label="Permalink to &quot;§ 50-73.3 Reserved name.&quot;">​</a></h1><p>A. A person may apply to the Commission to reserve the exclusive use of a limited partnership name, including a designated name for a foreign limited partnership. The limited partnership name applied for need not comply with subsection A of § <a href="http://law.lis.virginia.gov/vacode/50-73.2/" target="_blank" rel="noreferrer">50-73.2</a>. If the Commission finds that the limited partnership name is distinguishable upon the records of the Commission, it shall reserve the name for the applicant&#39;s exclusive use for a 120-day period.</p><p>B. The owner of a reserved limited partnership name may renew the reservation for successive 120-day periods each by filing with the Commission, during the 45-day period preceding the date of expiration of the reservation, a renewal application.</p><p>C. The owner of a reserved limited partnership name may transfer the reservation to any other person by delivering to the Commission a notice of the transfer, signed by the applicant for whom the name was reserved and specifying the name and address of the transferee.</p><p>D. A reserved limited partnership name may be used by its owner in connection with (i) the formation or an amendment to change the name of a domestic stock or nonstock corporation, limited liability company, business trust, or limited partnership; (ii) an application for a certificate of authority or registration to transact business in the Commonwealth as a foreign stock or nonstock corporation, limited liability company, business trust, or limited partnership; or (iii) an amended application for such authority or registration, provided that the proposed name complies with the provisions of § <a href="http://law.lis.virginia.gov/vacode/13.1-630/" target="_blank" rel="noreferrer">13.1-630</a>, <a href="http://law.lis.virginia.gov/vacode/13.1-762/" target="_blank" rel="noreferrer">13.1-762</a>, <a href="http://law.lis.virginia.gov/vacode/13.1-829/" target="_blank" rel="noreferrer">13.1-829</a>, <a href="http://law.lis.virginia.gov/vacode/13.1-924/" target="_blank" rel="noreferrer">13.1-924</a>, <a href="http://law.lis.virginia.gov/vacode/13.1-1012/" target="_blank" rel="noreferrer">13.1-1012</a>, <a href="http://law.lis.virginia.gov/vacode/13.1-1054/" target="_blank" rel="noreferrer">13.1-1054</a>, <a href="http://law.lis.virginia.gov/vacode/13.1-1214/" target="_blank" rel="noreferrer">13.1-1214</a>, <a href="http://law.lis.virginia.gov/vacode/13.1-1244/" target="_blank" rel="noreferrer">13.1-1244</a>, <a href="http://law.lis.virginia.gov/vacode/50-73.2/" target="_blank" rel="noreferrer">50-73.2</a>, or <a href="http://law.lis.virginia.gov/vacode/50-73.56/" target="_blank" rel="noreferrer">50-73.56</a>, as the case may be.</p><p>1985, c. 607; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0505" target="_blank" rel="noreferrer">505</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0444" target="_blank" rel="noreferrer">444</a>.</p>',6),n=[o];function s(l,h,p,d,c,f){return r(),a("div",null,n)}const g=e(i,[["render",s]]);export{v as __pageData,g as default};
